static PyObject *
_pygsl_lite_spline_eval_vector_generic(const gsl_spline * spline, const gsl_vector *x, gsl_interp_accel * acc,
				double (*spline_method)(const gsl_spline *, double, gsl_interp_accel *))
{
     size_t n, i;
     PyGSL_array_index_t n_a;
     double  *data;
     PyArrayObject * ret = NULL;

     FUNC_MESS_BEGIN();
     n = x->size;
     n_a = n;
     ret = PyGSL_New_Array(1, &n_a, NPY_DOUBLE);
     if(ret == NULL)
	  return NULL;

     data = (double *) PyArray_DATA(ret);
     for(i=0; i<n; ++i){
	  data[i] = spline_method(spline, gsl_vector_get(x, i), acc);
     }
     FUNC_MESS_END();
     return (PyObject *) ret;

}

static PyObject *
_pygsl_lite_spline_eval_e_vector_generic(const gsl_spline * spline, const gsl_vector *x, gsl_interp_accel * acc,
				  int (*spline_method)(const gsl_spline *, double, gsl_interp_accel * , double *))
{
     size_t i, n;
     int flag, lineno = -1;
     PyGSL_array_index_t n_a;
     double  *data, *ptr;
     PyArrayObject * ret = NULL;

     FUNC_MESS_BEGIN();
     n = x->size;
     n_a = n;
     ret = PyGSL_New_Array(1, &n_a, NPY_DOUBLE);
     if(ret == NULL){
	  lineno = __LINE__ - 2;
	  goto fail;
     }


     data = (double *) PyArray_DATA(ret);
     for(i=0; i<n; ++i){
	  ptr = &(data[i]);
	  flag = spline_method(spline, gsl_vector_get(x, i), acc, ptr);
	  if (PyGSL_ERROR_FLAG(flag) != GSL_SUCCESS){
	       lineno = __LINE__ - 2;
	       DEBUG_MESS(2, "Failed to evaluate element %ld", (long) i);
	       goto fail;
	  }
     }
     FUNC_MESS_END();
     return (PyObject *) ret;

 fail:
     PyGSL_add_traceback(module, __FILE__, __FUNCTION__, lineno);
     Py_XDECREF(ret);
     return NULL;
}


static PyObject *
_pygsl_lite_spline_eval_integ_vector(const gsl_spline * spline, const gsl_vector *a,
				const gsl_vector *b, gsl_interp_accel * acc)
{
     size_t i, n;
     PyGSL_array_index_t n_a;
     double  *data;
     PyArrayObject * ret = NULL;

     FUNC_MESS_BEGIN();
     n = a->size;
     if(b->size != n){
	  PyGSL_module_error_handler("Length of boundary b did not match boundary",
				     __FILE__, __LINE__ - 1, GSL_EBADLEN);
	  return NULL;

     }
     n_a = n;
     ret = PyGSL_New_Array(1, &n_a, NPY_DOUBLE);
     if(ret == NULL)
	  return NULL;

     data = (double *) PyArray_DATA(ret);
     for(i=0; i<n; ++i){
	  data[i] = gsl_spline_eval_integ(spline, gsl_vector_get(a, i), gsl_vector_get(b, i), acc);
     }
     FUNC_MESS_END();
     return (PyObject *) ret;

}

